import React from "react"
import { Routes, Route } from 'react-router-dom';
import "./App.css"



const App = () => {
  return(
    <main>
      <Routes>

        <Route path="/" element={LandingPage} />
        <Route path="/about" component={AboutPage} />
        {/* <Route path="/" component={Home} exact /> */}


      </Routes>
    </main>
  )
}
export default App
